import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import { Grid, Paper, Typography, Box } from '@mui/material';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';
import Map from './Map';
import './Dashboard.css';

function Dashboard() {
  const [soundscapeData, setSoundscapeData] = useState([]);
  const [error, setError] = useState(null);
  const [historicalData, setHistoricalData] = useState({});

  useEffect(() => {
    const fetchData = async () => {
      try {
        const locations = ['Downtown', 'Suburb', 'Central Park'];
        const data = await Promise.all(
          locations.map(async (location) => {
            const response = await fetch(`http://localhost:8000/soundscape/${location}`);
            if (!response.ok) {
              throw new Error(`HTTP error! status: ${response.status}`);
            }
            return response.json();
          })
        );
        setSoundscapeData(data);
        updateHistoricalData(data);
        setError(null);
      } catch (e) {
        console.error("Fetch error:", e);
        setError(e.message);
      }
    };

    fetchData();
    const interval = setInterval(fetchData, 5000);
    return () => clearInterval(interval);
  }, []);

  const updateHistoricalData = (newData) => {
    setHistoricalData(prevData => {
      const updated = { ...prevData };
      newData.forEach(item => {
        if (!updated[item.location]) {
          updated[item.location] = [];
        }
        updated[item.location].push({
          time: new Date().toLocaleTimeString(),
          noiseLevel: item.noise_level
        });
        if (updated[item.location].length > 20) {
          updated[item.location].shift();
        }
      });
      return updated;
    });
  };

  return (
    <Box className="dashboard" sx={{ p: 3 }}>
      <Typography variant="h2" className="dashboard-title" gutterBottom>
        Urban Soundscape Harmonizer
      </Typography>
      {error && <Typography color="error">Error: {error}</Typography>}
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Map soundscapeData={soundscapeData} />
        </Grid>
        {soundscapeData.map((data, index) => (
          <Grid item xs={12} md={4} key={index}>
            <motion.div
              initial={{ opacity: 0, y: 50 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
            >
              <Paper className="location-data" elevation={3} sx={{ p: 2, height: '100%' }}>
                <Typography variant="h5" gutterBottom>{data.location}</Typography>
                <Typography variant="h6" className="noise-level">
                  Noise Level: {Math.round(data.noise_level)} dB
                </Typography>
                <Box sx={{ height: 300, mt: 2 }}>
                  <ResponsiveContainer width="100%" height="100%">
                    <LineChart data={historicalData[data.location] || []}>
                      <CartesianGrid strokeDasharray="3 3" />
                      <XAxis dataKey="time" />
                      <YAxis domain={[0, 100]} />
                      <Tooltip />
                      <Line type="monotone" dataKey="noiseLevel" stroke="#8884d8" />
                    </LineChart>
                  </ResponsiveContainer>
                </Box>
                <Typography variant="body2" className="frequency-distribution" sx={{ mt: 2 }}>
                  Frequency Distribution: {data.frequency_distribution.map(f => f.toFixed(2)).join(', ')}
                </Typography>
              </Paper>
            </motion.div>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
}

export default Dashboard;
